def get_value(item):
    itemcheck = itemdetails['items'][str(item)][3]

    if str(itemcheck) != "-1":
        return itemdetails['items'][str(item)][3]
    else:
        return itemdetails['items'][str(item)][2]


auth = config['auth']
percentage = config['percentage']
scraper = cloudscraper.create_scraper()
auth = auth

notified_items = {}  # dictionary to store uuids of notified items


while True:
    try:
        request = scraper.get("https://api.bloxflip.com/limiteds", headers={"x-auth-token": auth}).json()
        for items in request:
            # Check if request[items] is a dictionary
            if not isinstance(request[items], dict):
                continue
                
            listing = request[items]["items"][0]["listing"]
            name = request[items]["items"][0]["limited"]["name"]
            item_id = int(listing["assetId"])

            if item_id in notified_items:
                continue  # skip if item has already been notified

            price = int(listing["itemPrice"])
            value = get_value(int(listing["assetId"]))

            goodornot = price - value

            profit = value * 1.4

            if price <= percentage * value:
                if webhook_enable == "True":
                    embed = DiscordEmbed(title=f"{name} is selling for {price} goo!", url="https://bloxflip.com/marketplace", color=0xFFC800)
                    embed.add_embed_field(name="How much overpriced", value=f"{goodornot}")
                    embed.add_embed_field(name="Price", value=f"{price} Price")
                    embed.add_embed_field(name="Max Price", value=f"{profit} R$")

                    embed.set_timestamp()
                    webhook.clear_attachments
                    webhook.add_embed(embed)
                    webhook.execute()

                # execute the toast notification here
                if winnotif == "True":
                    toast.show_toast("Bloxflip Marketplace Nottif ", f"Name: {name} Price: {price} ", icon_path="logo.ico", duration=0)
                    notified_items[item_id] = True
    
            # remove item ID from dictionary when it is sold or its price goes above the threshold
            if item_id in notified_items and price > percentage * value:
                del notified_items[item_id]

        else:
            print('No Item found')

    except json.decoder.JSONDecodeError as e:
        print(f"Error. Retrying in 5 seconds...")
        time.sleep(refresh1)
    continue

